import React from "react";
import { Link } from "react-router-dom";

const AboutUs = () => {
  return (
    <div class="container">
      <div class="row justify-content-md-center">
        <div class="my-4 col-auto">
          <h1>The Authors of This Application</h1>
        </div>
      </div>
      <div class="row">
        <div class="col"></div>
      </div>
    </div>
  );
};

export default AboutUs;
